import React from 'react';
import './Home.css';

function Home({ selectedOption }) {
  let cardColor = '#ffffff'; 
  let titleText = 'Discover the hues of possibility with our vibrant color palette';
  let imgSrc = '';
  let col='';

  switch (selectedOption) {
    case 'dashboard':
      cardColor = '#ffcccc';
      titleText = 'LIGHT RED';
      col='red';
      imgSrc='data:image/jpeg;base64,'
      break;
    case 'products':
      cardColor = '#ccffcc';
      titleText = 'LIGHT GREEN';
      col='green';
      imgSrc='https://th.bing.com/th?id=OIP.csrlEcb5jZUXjfm0Wt3W6gHaFj&w=288&h=216&c=8&rs=1&qlt=90&o=6&dpr=1.1&pid=3.1&rm=2';
      break;
    case 'categories':
      cardColor = '#AD88C6';
      titleText = 'LAVENDER';
      col='violet';
      imgSrc='https://th.bing.com/th?id=OIP.bBCkzJj51SIeduPzXoAK-wHaFj&w=288&h=216&c=8&rs=1&qlt=90&o=6&dpr=1.1&pid=3.1&rm=2'
      break;
    case 'customers':
      cardColor = '#EBE3D5';
      titleText = 'BEIGE';
      col='brown';
      imgSrc='https://th.bing.com/th?id=OIP.pe1uIjyF4K-8ItCIxFVlzQHaEh&w=319&h=195&c=8&rs=1&qlt=90&o=6&dpr=1.1&pid=3.1&rm=2';
      break;
    case 'inventory':
      cardColor = '#C6DCBA';
      titleText = 'PALE GREEN';
      col='lightgreen';
      imgSrc='data:image/jpeg;base64,'
      break;
    case 'reports':
      cardColor = '#ccffcc';
      titleText = 'PALE LIME';
      col='green'
      imgSrc='https://th.bing.com/th/id/OIP.N4Q7Pmo-L4gpIA60MNJAYwHaHE?w=160&h=184&c=7&r=0&o=5&dpr=1.1&pid=1.7'
      break;
    case 'settings':
      cardColor = '#DC8686';
      titleText = 'LIGHT CORAL';
      col='lightbrown'
      imgSrc='data:image/jpeg;base64,'
      break;
    default:
      cardColor = 'lightblue'; 
      col='darkblue';
      titleText = 'Discover the hues of possibility with our vibrant color palette';
      imgSrc='data:image/jpeg;base64,';
  }

  return (
    <main className='main-container'>
      <div className='main-title'>
        <h3>{titleText}</h3>
      </div>

      <div className='main-cards'>
        <div className='card' style={{ backgroundColor: cardColor ,color:col}}>
          <div className='card-inner'>
            <center><h1 style={{'font-family': 'Roboto','font-style': 'italic'}}>{titleText}</h1></center>
            {imgSrc && <img src={imgSrc} alt={titleText} style={{ width: '500px', height: '300px', margin: 'auto', display: 'block' }} />}
          </div>
        </div>
      </div>
    </main>
  );
}

export default Home;
